 INSERT INTO srdb.assessment VALUES('DFO-NFLD-AMPL23K-1960-2004-PREFONTAINE', 'DFO-NFLD', 'AMPL23K', 'PREFONTAINE', '2008-06-03', '2011-06-14 14:16:11', '1960-2004', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'Karen Dwyer, Karen.Dwyer@dfo-mpo.gc.ca', 'The fishing mortality is estimated by the catch/index survey biomass and can be found in the report as a time series in Figure 18. The index for female spawning stock biomass is also found as a time series in the assessment in Figure 12. The time series for total biomass and recruits are in millions of campelen units; the numbers are weighed according to the different gears used in the survey used. Additional extended time series (spawning stock biomass, recruits and total biomass) were provided by Karen Dwyer.', '', 0, 0, 'Survey indices', '', '../spreadsheets/PREFONTAINE-AMPL23K-2003-editedDR-QAQC.xls', '999') ; 
